import React from 'react'

const MainIndexComponent = () => {
    return (
        <>
            <div className="mainContainer">
                <div className="tiles">
                    <div className="tile1">
                        <img src="/mainComponentImages/tile_1.png" alt="Tile1" />
                    </div>
                </div>
            </div>
        </>
    )
}

export default MainIndexComponent;
